// Canvas & image
var CANVAS_WIDTH;
var CANVAS_HEIGHT;
var canvasElement = $("<canvas></canvas>");
var canvas;
var baselineCanvasElement;
var baselineCanvas;
var baselineImgd;
var baselineData;
var imgd;
var data;

// Misc
var start = false;
var step = false;

// Population
var populationSize;
var minNumberOfMutations;
var maxNumberOfMutations;
var maxNumberOfMutationsCeiling = 8;
var maxForce;
var population;
var bestPopulation;
var mutations = 0;
var improvements = 0;
var rand;
var force;
var mutationType = 4;
var randomMutations = false;

var increasePoly = true;
var increasePolyCount = 0;
var increasePolyCountMax = 500;

// Simulated annealing 
var doSimulatedAnnealing = false;
var P;
var temperature = 1.0;
var deltaE;
var initialAlpha = 0.99;
var alpha;
var temperatureStep = 0;
var maxTemperatureStep = 100;
var returnToBest = true;
var stepsToReturnToBest = 500;
var counter = 0;

// Show info
var time = 0;
var startElapsed;
var endElapsed;

// Update loop, runs the algo or steps through it and computes time
function update(){
  if (start || step){
    //startElapsed = new Date().getTime();
    simulatedAnnealing();
    writeInfo();
    step = false;
    endElapsed = new Date().getTime();
    time = endElapsed - startElapsed;
  }
  setTimeout(update,0);
}

// Create 2 canvases, one for the original image (baseline) and one for the result image
function setUpCanvas(width,height){
  reset();
  CANVAS_WIDTH = width;
  CANVAS_HEIGHT = height;

  // Creates and appends baseline canvas to html
  baselineCanvasElement = $("<canvas class='canvasBaseline' width='" + CANVAS_WIDTH + "' height='" + CANVAS_HEIGHT + "'></canvas>");
  baselineCanvas = baselineCanvasElement.get(0).getContext("2d");
  baselineCanvasElement.appendTo('.container');
  baselineCanvas.fillStyle = "white";

  // Computes baseline image data
  var img = $('.baseline')[0];
  baselineCanvas.drawImage(img,0,0);

  baselineImgd = baselineCanvas.getImageData(0,0,CANVAS_WIDTH,CANVAS_HEIGHT);
  baselineData = baselineImgd.data;

 
  // Creates and appends the initial blank result canvas to html
  canvasElement = $("<canvas class='canvasNew' width='" + CANVAS_WIDTH + "' height='" + CANVAS_HEIGHT + "'></canvas>");
  canvas = canvasElement.get(0).getContext("2d");
  canvasElement.appendTo('.container');
  canvas.fillStyle = "white";
  canvas.fillRect(0,0,CANVAS_WIDTH,CANVAS_HEIGHT);

  // Sets up population: uses canvas size for initial values and limits 
  setUpPopulation();
  maxForce = CANVAS_WIDTH/4;
  force = maxForce;
  writeInfo();
}

function setUpPopulation(){
  populationSize = parseInt($('.polyNbChange').val());
  population = new Population();
  population.setup(populationSize);
  population.setInitialFitness();
  bestPopulation = clonePopulation(population);
  //bestPopulation = new Population();
  setMutationToRandom();
}

// Mutates the population. If the fitness of the mutated pop is better, keep it,
//  else, revert back or keep it, depending of P value.
// See https://en.wikipedia.org/wiki/Simulated_annealing
// See http://www.mit.edu/~dbertsim/papers/Optimization/Simulated%20annealing.pdf
// See http://katrinaeg.com/simulated-annealing.html
function simulatedAnnealing(){
  if(randomMutations)
    setMutationToRandom();
  rand = getRandomInt(0,population.population.length);
  population.mutate(rand);

  population.computeFitness();
  mutations++;
  counter++;


  // Only decrement temperature after x iterations
  if(doSimulatedAnnealing){
    if (temperatureStep<maxTemperatureStep)
      temperatureStep++;
    else{
      temperature *= alpha;
      temperatureStep = 0;
    }
  }
  
  // First Case : fitness > old fitness. Keep the solution
  if (population.fitness > population.oldFitness){
    improvements++;
    increasePolyCount = 0;
    if(population.fitness > bestPopulation.oldFitness)
      bestPopulation = clonePopulation(population);
    return;
  }

  if (doSimulatedAnnealing){
    // Second case : fitness < old fitness. 
    // Difference in fitness of the 2 solutions
    deltaE = population.oldFitness - population.fitness;

    // Acceptance probability
    // P is higher if deltaE is lower 
    // P gets lower and lower with temperature decrease
    P = Math.exp(-deltaE/temperature);
    
    // Keep the solution if a random(0,1) < P
    if(deltaE>0 && Math.random() < P){
      //  improvements++;
      if (population.Fitness > bestPopulation.oldFitness)
         bestPopulation = clonePopulation(population);
      return;
    }

    // If returnToBest is checked, periodically return to the best population
    // Allows to not deviate too much from the best pop, even at high temperatures
    if (returnToBest && counter > stepsToReturnToBest){
      counter = 0;
      population = clonePopulation(bestPopulation);
    }
  }

  if(increasePoly){
    increasePolyCount++;
    if(increasePolyCount>increasePolyCountMax){
      addPolygon();
      increasePolyCount = 0;
    }
  }

  // Discard the new solution and return to the previous one
  population.population[rand].revert();
  population.fitness = population.oldFitness;
}

function addPolygon(){
  population.population.push(new Polygon());
  population.computeFitness();
  //populationSize++;
  $('.polyNbChange').val(population.population.length);
}

// Resets all variables when a new image is chosen
function reset(){
  mutations = 0;
  improvements = 0;
  start = false;
  temperature = 1.0;
  time = 0;
  startElapsed = new Date().getTime();
  alpha = initialAlpha;
  minNumberOfMutations = 1;
  maxNumberOfMutations = maxNumberOfMutationsCeiling;
  $('canvas').remove();
  $('baselineCanvas').remove();
  $('.start').text("Start");
}

// Creates a "demo" canvas, with a set image
function initialCanvas(){
  var div = document.createElement('img');
  div.className = 'baseline';
  div.src="data:image/jpeg;base64,";
  document.getElementById('output').insertBefore(div, null);
  var height = 256;
  var width = 256;
  setUpCanvas(256, 256);
}

// Starts the simulation in the update loop, and the timer
function startAlgo(){
  start= !start;
  startElapsed = new Date().getTime();
  $('.start').text(function(i, text){
    return text === "Start" ? "Pause" : "Start";
  })
}

// Does one step of simulation
function stepAlgo(){
  step = true;
}

//Display main info on GUI
function writeInfo(){
  $('.improvements').text("Improvements : " + improvements);
  $('.fitness').text("Fitness : " + round(population.fitness,3));
  $('.bestFitness').text("Best Fitness : " + round(bestPopulation.fitness,3));
  $('.mutations').text("Mutations : " + mutations);
  $('.Temperature').text("Temperature : " + round(temperature,7));
  $('.Time').text("Time : " + msToTime(time));
}

